class App extends Component {
  state = {
    articles: [],
  }

  componentDidMount = ()=>{
    fetch("http://localhost:3012/", {mode:"cors"})
    .then(res => {
      if(res.headers.get("content-type") &&
        res.headers.get("content-type").toLowerCase().indexOf("application/json") >= 0) {
        return res.json()
      } else {
        throw new TypeError()
      }
    }).then(processJSON)
  }

  render() {
    return (
      <div className="App">
        <h1>hello</h1>
      </div>
    );
  }
}

export default App;
